Yes, all plants are plants;
Yes, by logic all plants are plants;
Yes, it's a tautology that all plants are plants.

British people don't have bad teeth;

British people don't have worse teeth than other countries;

It's false that British people have bad teeth

No, it is not definite that climate change will lead to human extinction; 

It is highly likely that human beings will go extinct as a result of climate change; 

There is evidence of runaway climate change including extreme weather events, permafrost thawing, ocean acidification and rising sea levels; 

There are models that suggest an abrupt and irreversible climate change leading to human extinction;

No, evidence suggests that learning music does not increase thinking ability;
No, the effect on learning music on thinking is minimal;
No, there is no transfer of abilities from music to thinking.

Old soldiers never die;

Although physically strong, they tend to become emotionally exhausted from watching too many war movies;

They often experience vivid flashbacks of traumatic experiences from their military service, which in-turn overwhelms their mind and causes psychological issues such as anxiety and depression;

Due to lack of social interaction and personal support, they often suffer from loneliness and become dependent on care and attention from family members;

In extreme cases, this can lead to high suicide rates.

No, CPR is recommended in the case of a cardiac flatline;
No, CPR and the injection of vasopressin, epinephrine, or atropine are recommended in the case of a cardiac flatline;
No, defibrillation is not recommended in the case of a cardiac flatline;
No, it is a myth from medical dramas that defibrillation is used in the case of a cardiac flatline;
No, while medical dramas show the use of defibrillation in the case of a cardiac flatline, it is not recommended

